import React from 'react';
import RepoItem from './RepoItem';
import PropTypes from 'prop-types';

const Repos = (props) => {
  console.log(props);
  return 'Test';
};

Repos.prototype = {
  repos: PropTypes.array.isRequired,
};

export default Repos;
